import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { FiHome, FiUser, FiUsers, FiSettings, FiLogOut, FiBarChart2 } from "react-icons/fi";

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const token = localStorage.getItem("token");
        if (!token) {
          navigate("/signin");
          return;
        }

        const res = await fetch("http://localhost:5001/dashboard", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${token}`, // Ensure Bearer token format
          },
        });

        if (res.status === 403) throw new Error("Unauthorized");

        const data = await res.json();
        setUser(data);
      } catch (error) {
        console.error("Dashboard error:", error);
        navigate("/signin");
      }
    };

    fetchUser();
  }, [navigate]);

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-64 bg-gray-800 text-white flex flex-col min-h-screen">
        <div className="p-6 text-center text-lg font-bold border-b border-gray-700">
          Admin Dashboard
        </div>
        <nav className="flex-1 p-4 space-y-2">
          <NavItem icon={<FiHome />} text="Home" href="/dashboard" />
          <NavItem icon={<FiUser />} text="Profile" href="/dashboard/profile" />
          <NavItem icon={<FiUsers />} text="Users" href="/dashboard/users" />
          <NavItem icon={<FiSettings />} text="Settings" href="/dashboard/settings" />
        </nav>
        <button
          onClick={() => {
            localStorage.removeItem("token");
            navigate("/signin");
          }}
          className="mt-auto bg-red-600 hover:bg-red-700 text-white flex items-center gap-2 justify-center py-3"
        >
          <FiLogOut /> Logout
        </button>
      </aside>

      {/* Main Content */}
      <div className="flex-1 flex flex-col bg-white">
        {/* Top Navbar */}
        <header className="bg-white shadow-md flex justify-between items-center px-6 py-4 border-b">
          <h1 className="text-2xl font-semibold text-gray-800">Dashboard</h1>
          <div className="text-gray-700 font-medium">{user?.username}</div>
        </header>

        {/* Dashboard Content */}
        <main className="p-6">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <StatCard title="Users" value="1,230" icon={<FiUsers />} />
            <StatCard title="Revenue" value="$50,420" icon={<FiBarChart2 />} />
            <StatCard title="Active Sessions" value="321" icon={<FiUser />} />
          </div>
        </main>
      </div>
    </div>
  );
};

// Sidebar Navigation Item Component
const NavItem = ({ icon, text, href }) => (
  <a
    href={href}
    className="flex items-center px-4 py-2 rounded-lg hover:bg-gray-700 transition duration-300"
  >
    {icon}
    <span className="ml-3">{text}</span>
  </a>
);

// Statistic Card Component
const StatCard = ({ title, value, icon }) => (
  <div className="bg-white shadow-md rounded-lg p-6 flex items-center hover:shadow-lg transition duration-300">
    <div className="text-3xl text-gray-700">{icon}</div>
    <div className="ml-4">
      <h3 className="text-gray-500">{title}</h3>
      <p className="text-xl font-bold">{value}</p>
    </div>
  </div>
);

export default Dashboard;
